import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class Green extends Component {

    constructor(props) {
      super(props);
      this.state = {
        backgroundImage: url("")
      }
    }


    boxClick = (e) => {
      this.setState({
        backgroundImage: "green.png"
      })
    }

    render() {
      return (
        <div className="App">


          <article className='experimentsHolder'>
            <div className="boxClickCss" 
            style={{backgroundImage: this.state.backgroundImage}}
             onClick={this.boxClick}>Green</div>
          </article>

        </div>
      );
    }
  }

  ReactDOM.render(<Green />, document.getElementById('screen'));
